// import moment from 'moment';

const Message = ({message}) => {
    return (
        <div>
            <li>
                <span className="text-danger"><em></em></span> : <span className="username"></span>
                <p className="text-muted">{message}</p>
            </li>
        </div>
    )
}

export default Message
